import React from "react";
import "./App.css";
import Home from "./Home";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
class App extends React.Component {
  render() {
    return (
      <Router>
        <div className="App">
          <Switch>
            <Route Component={Home} path="/" />
          </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
